import React from 'react'
import './HeroSection.css'
import PlaceholderVideo from '../resources/videos/PlaceholderVideo.mp4';

function HeroSection() {
    return (
        <div className='hero-container'>
            <video src={PlaceholderVideo} autoPlay loop muted />
            <div class="container">
              <h1>This <span class="highlight-container"><span class="highlight">Highlight</span></span> is in the Heading</h1>
              <p>This content is dope. <span class="highlight-container"><span class="highlight">This is a highlight.</span></span> And it's also dope.</p>
              <p><small>This <span class="highlight-container"><span class="highlight">highlight</span></span> is small.</small></p>
            </div>
        </div>
    )
}
export default HeroSection
